import Image from "../imgs/logo-colors-f7-bg-130.png"
import "./index.css"
function Header(){
    return(
<div className="Header p-3">
    <img className="ms-auto me-auto" src={Image} alt=""/>
    <div className="img">
        <p className="">النتائج الامتحانية للكليات حسب الرقم الجامعي</p>
    </div>

</div>
    )
}
export default Header
